serbuk sari, udara dingin, bulu binatang, bau-bauan yang menyengat, dll. Akan tetapi ada penyebab lain yang dapat memicu sesak nafas didada, yaitu karena factor keturunan, kurangnya asupan cairan dalam tubuh, factor lingkungan, produksi lendir yang berlebih dan ketidakstabilan emosi.</span></p>
<p style="text-align:justify;"><span style="text-decoration:underline;"><span style="color:#ff6600;text-decoration:underline;"><strong>Gejala Penyakit Sesak Nafas</strong></span></span></p>
<ul>
<li><span style="color:#000000;">Dada terasa sempit dan terkadang sakit.</span></li>
<li><span style="color:#000000;">Nafas mejadi pendek dan terasa sesak.</span></li>
<li><span style="color:#000000;">Batuk yang berkepanjangan saat cuaca dingin.</span></li>
<li><span style="color:#000000;">Suara sengau atau siulan ketika bernafas (bengek).</span></li>
<li><span style="color:#000000;">Batuk menjadi lebih parah ketika flu atau pilek.</span></li>
<li><span style="color:#000000;">Kesulitan untuk tidur karena terasa pengap.</span></li>
<li><span style="color:#000000;">Pengetatan pada otot dada sehingga dada terasa sakit.</span></li>
</ul>
